import './App.css';
import { Notifications } from './Notifications';
import { Header } from './Header/Header';
import { Login } from './Login/Login';
import { Footer } from './Footer/Footer';

function App() {
  return (
    <React.Fragment>
        <Notifications />
      <div className="App">
        <Header />
        <Login />
        <Footer />
      </div>
    </React.Fragment>
  );

}

export default App;
